import React, { Component } from 'react';
import styles from './resume.module.scss';
import ResumeList from '../../components/ResumeList';
import Experience from "../../experience.json";
import Education from "../../education.json";
import CodingSkillset from "../../codingSkillset.json";
import SoftwareSkillset from "../../softwareSkillset.json";

class Resume extends Component {
    render() {
        const experienceDate = Experience.date;
        const educationDate = Education.date;
        const codingSkillset = CodingSkillset.date;
        const softwareSkillset = SoftwareSkillset.date;
        return (
            <div>
            <section className={ styles.wrap }>
                <div className={ styles.title }>
                    <div className={ styles.square }></div>
                    <p>resume</p>
                </div>
            </section>
            <ResumeList experienceDate={ experienceDate } educationDate= { educationDate } codingSkillset = { codingSkillset } softwareSkillset = { SoftwareSkillset }/>
        </div>
        )
    }
}

export default Resume;
